  	  <div>
				<TwitchPlayer
          channel={ampm_m}
          width="100%"
          height="100%"
          onOnline={() => setOnline(true)}
          onOffline={() => setOnline(false)}
          onReady={(p) => {
            player.current = p
          }}
          parent={['codesandbox.io', 'csb.app']}
        />
				<twitch-stream channel="ampm_m" muted={this.props.muted}></twitch-stream>;
